(window.webpackJsonp=window.webpackJsonp||[]).push([[795],{1150:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1689-nham-thanh-vien-đam-nguoi-kinh-ngac"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1689-nham-thanh-vien-đam-nguoi-kinh-ngac"}},[n._v("#")]),n._v(" Chương 1689: Nhậm Thanh Viễn đám người kinh ngạc")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1689: Nhậm Thanh Viễn đám người kinh ngạc"),t("br"),t("br"),n._v("“Liên minh?”"),t("br"),t("br"),n._v("Nhậm Thanh Viễn giật mình."),t("br"),t("br"),n._v("“Căn cứ ta được đến tin tức, đối phương tập kết mười vạn binh sĩ, một khi hoàn thành ước định, bất cứ lúc nào cũng sẽ tấn công... Tin tức không sai, chính là Danh Sư đường nơi này Địa quật!”"),t("br"),t("br"),n._v("Tưỏng Phương Du một mặt khẳng định."),t("br"),t("br"),n._v("“Danh Sư đường Đại Thánh đỉnh phong cấp bậc thái thượng trưởng lão, hầu như đều đi Khổng miếu, bình thường danh sư, phân tán trấn thủ Địa quật, coi như triệu tập, tu vi của bọn hắn, cũng không chịu nổi truyền tống trận áp lực, bay trở về lời nói, thời gian không đuổi kịp...”"),t("br"),t("br"),n._v("Nhậm Thanh Viễn mày nhăn lại."),t("br"),t("br"),n._v("Tin tức nếu như là thật, lần này nguy cơ thực sự quá lớn."),t("br"),t("br"),n._v("Trong lúc nhất thời, ngay cả hắn, đều không có biện pháp gì tốt."),t("br"),t("br"),n._v("“Ta biết lần này dính dáng nhân tộc sinh tử, vì lẽ đó mang theo trong tộc đỉnh tiêm cao thủ, cũng để cho Lạc huynh đem bọn hắn gia tộc cường giả đều cùng nhau mang theo tới, trợ giúp Danh Sư đường tổng bộ, thủ hộ Địa quật!”"),t("br"),t("br"),n._v("Tưỏng Phương Du nói."),t("br"),t("br"),n._v("“Làm phiền Tưởng huynh phí tâm, đã như vậy, việc này không nên chậm trễ, kỹ càng kế hoạch tác chiến, chờ vào Địa quật rồi nói sau, không phải, ta sợ, chúng ta còn không có thảo luận ra cái gì, đối phương đã bắt đầu tấn công...”"),t("br"),t("br"),n._v("Sự tình không chần chờ, Nhậm Thanh Viễn đám người, không tại nói nhảm, vội vã hướng Địa quật đi đến."),t("br"),t("br"),n._v("Cùng Trương gia Long Hổ Sơn Địa quật đồng dạng, phong ấn đằng sau, cũng có cái to lớn thành trì, trấn áp lối ra."),t("br"),t("br"),n._v("Dị Linh tộc nhân muốn đi vào danh sư đại lục, nhất định phải thông qua nơi này."),t("br"),t("br"),n._v("“Đối diện tình huống như thế nào?”"),t("br"),t("br"),n._v("Đứng ở trên khán đài, Nhậm Thanh Viễn nhìn về phía cách đó không xa một vị cửu tinh danh sư."),t("br"),t("br"),n._v("“Một mực không có động tĩnh, mới vừa nhận được trinh sát truyền về tin tức, đối phương tất cả binh sĩ, đều lùi đến phong ấn về sau, tựa hồ tại mưu đồ bí mật cái gì, bởi vì cổ chiến trường sát lục chi khí có thể ảnh hưởng tâm trí, vì lẽ đó, không có quá nhiều đi sâu, tình huống cụ thể, còn không biết được!”"),t("br"),t("br"),n._v("Vị này cửu tinh danh sư nói."),t("br"),t("br"),n._v("“Ừm!”"),t("br"),t("br"),n._v("Nhậm Thanh Viễn lên tiếng."),t("br"),t("br"),n._v("Dị Linh tộc nhân vị trí cổ chiến trường, Huyết Nguyệt giữa trời, sát lục chi khí nồng đậm, bình thường danh sư tiến vào bên trong, không bao lâu, liền sẽ bị tức tức lây nhiễm, biến thành chỉ biết giết người máy móc."),t("br"),t("br"),n._v("Nguyên nhân chính là như vậy, nhân tộc cùng Dị Linh tộc nhân đối chiến, cơ bản đều là duy trì phòng ngự, mà không phải chủ động tấn công."),t("br"),t("br"),n._v("Không phải, vài vạn năm đến, Danh Sư đường cường giả vô số, cũng không có khả năng cho phép, Dị Linh tộc nhân trở nên cường đại như vậy."),t("br"),t("br"),n._v("“Một mực tại nơi này chờ lấy cũng không phải phương pháp, đã phong ấn chỗ, không bao nhiêu người thủ hộ, ta muốn tự thân đi qua dò xét một cái, mọi người cũng có thể sớm chuẩn bị!”"),t("br"),t("br"),n._v("Trầm tư một chút, Tưỏng Phương Du nói."),t("br"),t("br"),n._v("“Tưởng huynh, ta và ngươi cùng một chỗ, ta đối không gian gần nhất có lĩnh ngộ mới, che giấu phương diện, chỉ cần thực lực không cao hơn ta, sẽ rất khó phát hiện!”"),t("br"),t("br"),n._v("Lạc Càn Trinh tiến về phía trước một bước."),t("br"),t("br"),n._v("“Chuyện này...”"),t("br"),t("br"),n._v("Nhậm Thanh Viễn chần chờ một chút, xoay người dặn dò: “An bài tất cả danh sư, làm ra tùy thời chiến đấu chuẩn bị, ta cùng Tưởng huynh, Lạc huynh đi dò xét một cái liền trở lại!”"),t("br"),t("br"),n._v("Trinh sát không cách nào đi sâu cổ chiến trường, dò xét tin tức có hạn, đã như vậy, còn không bằng hắn tự thân xuất mã."),t("br"),t("br"),n._v("“Quyền đường chủ...”"),t("br"),t("br"),n._v("Rất nhiều cửu tinh danh sư khuyên can."),t("br"),t("br"),n._v("“Không sao, chỉ là dò xét tin tức, lại có Lạc huynh cùng Tưởng huynh tại, không có vấn đề quá lớn!” Cắt đứt lời của mọi người, Nhậm Thanh Viễn làm ra nghị quyết."),t("br"),t("br"),n._v("Thấy hắn thái độ, mọi người biết không thể sửa đổi, không nói thêm lời."),t("br"),t("br"),n._v("Sự tình gấp gáp, không có trì hoãn, ba người ẩn nặc thân hình, vội vã bay tới đằng trước."),t("br"),n._v(" Chỉ chốc lát đi tới phong ấn trước mặt."),t("br"),t("br"),n._v("Cùng đối phương nói đồng dạng, Dị Linh tộc nhân quả thực không có quá lớn đề phòng, đóng giữ binh sĩ, thực lực đều không mạnh, căn bản không phát hiện được hành tung của bọn hắn."),t("br"),t("br"),n._v("Đi vào cổ chiến trường, sát lục chi khí vọt tới, biết kiên trì lâu, liền xem như bọn họ, cũng sẽ bị loại khí tức này xâm nhập trong cơ thể, khó mà khu trừ, mấy người tăng thêm tốc độ."),t("br"),t("br"),n._v("“Bên kia sóng linh khí rất lớn, đi qua nhìn một chút...”"),t("br"),t("br"),n._v("Phi hành không xa, lập tức cảm thấy một chỗ linh khí hỗn loạn, tựa như gió lốc, mọi người nhìn nhau, nhanh chóng bay lượn mà đi."),t("br"),t("br"),n._v("Còn chưa tới đến trước mặt, ba người liền ẩn tàng lại thân hình, sợ gây nên năng lượng ba động, bị đối phương phát hiện."),t("br"),t("br"),n._v("Thật vất vả đi tới trước mặt, xuyên thấu qua sơn phong hướng chỗ trũng nhìn lại, vừa nhìn phía dưới, Nhậm Thanh Viễn thân thể nhoáng một cái, suýt chút nữa ngã sấp xuống."),t("br"),t("br"),n._v("“Làm sao vậy?”"),t("br"),t("br"),n._v("Thấy hắn bộ dáng này, Tưỏng Phương Du nhịn không được nghi ngờ nhìn qua."),t("br"),t("br"),n._v("“Chính các ngươi nhìn...” Nhậm Thanh Viễn bờ môi run rẩy."),t("br"),t("br"),n._v("Lạc Càn Trinh, Tưỏng Phương Du tràn đầy nghi ngờ, đứng dậy, đồng dạng liếc mắt nhìn, cũng từng người trợn to hai mắt."),t("br"),t("br"),n._v("“Những người này... Đều đã chết?”"),t("br"),t("br"),n._v("Chỉ thấy trước mắt sơn cốc, lít nha lít nhít chất đầy Dị Linh tộc nhân thi thể, không biết bao nhiêu."),t("br"),t("br"),n._v("Bọn họ tràn đầy lo lắng, tiêu tốn vô số tâm huyết đề phòng... Kết quả, đám này Dị Linh tộc nhân còn chưa có đi ra, liền tất cả đều chết rồi... Đến cùng xảy ra chuyện gì?"),t("br"),t("br"),n._v("“Đi qua nhìn một chút!”"),t("br"),t("br"),n._v("Mọi người chết rồi, lại không có gì có thể sợ hãi, mọi người nhanh chóng bay đi."),t("br"),t("br"),n._v("Đi tới bầu trời, liên tục bay một vòng."),t("br"),t("br"),n._v("“Tinh Hoàng cùng Linh Hoàng mười vạn binh sĩ, hẳn là đều ở nơi này, hình như là... Lẫn nhau chiến đấu mà chết!” Tưỏng Phương Du bờ môi run rẩy, một mặt vẻ mặt như gặp phải quỷ."),t("br"),t("br"),n._v("Ẩn giấu ở Dị Linh tộc nhân bên trong vu hồn sư tiền bối, lặng lẽ đưa tin tới, nói hai đại Hoàng giả liên thủ, một khi tấn công, nhất định thế như chẻ tre, để nhân tộc nhất thiết phải sớm chuẩn bị..."),t("br"),t("br"),n._v("Biết tin tức này, lo lắng, sợ ngăn cản không nổi... Kết quả, người còn không có xuất hiện, liền chết hết... Cái này mẹ nó, tình huống gì?"),t("br"),t("br"),n._v("Ai có thể giải thích một câu ư?"),t("br"),t("br"),n._v("“Chẳng lẽ, hai đại Hoàng giả, liên minh sự tình không có thảo luận tốt, ở đây lại đánh một hồi... Cuối cùng toàn quân bị diệt?” Lạc Càn Trinh nhịn không được nói."),t("br"),t("br"),n._v("Tuy là nghe rất kéo, nhưng hắn thực sự nghĩ không ra, đây rốt cuộc giải thích như thế nào."),t("br"),t("br"),n._v("“Nếu như là hai đại Hoàng giả, không ai nhường ai, cuối cùng dẫn đến chiến đấu, coi như đều có tổn thương, cũng không thể nào làm được toàn quân bị diệt... Khẳng định là có người ở đây, đem còn lại giết! Các ngươi nhìn, bên kia mấy ngàn Dị Linh tộc nhân, kiểu chết giống nhau y hệt, hơn một ngàn người, bị một loại quái lực đập thành bánh thịt, hơn một ngàn người, bị đâm xuyên trái tim, một phần khác, thì là bị chém xuống đầu lâu...”"),t("br"),t("br"),n._v("Lắc đầu, Nhậm Thanh Viễn nói."),t("br"),t("br"),n._v("Hắn thân là cửu tinh danh sư, quan sát cẩn thận, hai vị cao thủ, tự giết lẫn nhau, có lẽ có thể song song vẫn lạc, mười vạn người quân đội... Không có ngoại lực quấy nhiễu, lại thế nào giao chiến, cũng không đến mức, tất cả đều chết rồi, không còn một mống a?"),t("br"),t("br"),n._v("“Nhậm đường chủ nói không sai, không chỉ có như vậy, cái này mười vạn quân đội trang bị vật tư, tất cả đều không thấy, hơn nữa trên người bọn họ trữ vật giới chỉ, cũng không nhìn thấy một cái... Khẳng định là bị người thu!” Tưỏng Phương Du nói."),t("br"),t("br"),n._v("Lạc Càn Trinh vội vàng nhìn lại, quả nhiên thấy thương vong vô số Dị Linh tộc nhân, trên tay tất cả đều trụi lủi, một chiếc nhẫn đều không có, hơn nữa lều vải chỗ, đều có lửa đốt dấu vết, bên trong nhưng không có mảy may quân bị cái bóng."),t("br"),t("br"),n._v("Như thế lớn quân đội, không có vật tư tài nguyên, là không thể nào."),t("br"),t("br"),n._v("Hiện tại không có cái gì, chỉ có một lời giải thích... Vậy chính là, đã có người đến, hơn nữa trận chiến tranh này, vô cùng có khả năng đều là xuất từ bọn họ tay."),t("br"),t("br"),n._v("Chỉ là..."),t("br"),t("br"),n._v("Đến cùng người nào, có loại năng lực này, để mười vạn Dị Linh tộc nhân, ngắn ngủi không tới một ngày, toàn quân bị diệt?"),t("br"),t("br"),n._v("Hô!"),t("br"),t("br"),n._v("Đúng lúc này, một cỗ khí tức bay lượn mà đến, một bóng người bất ngờ xuất hiện tại sơn cốc bầu trời."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1700"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1702"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);